import { Link } from 'react-router-dom';

const Navbar = () => {
    return (
        <header>
            <div className="container">
                <div className="navbarItems"></div>
                    <Link to="/">
                        <h1>Todo list</h1>
                    </Link>
            </div>
        </header>
    )
}

export default Navbar
